{
"HTMLexport":{
"ExcludeDefaultLibraries":false,
"ExpertMode":false,
"Header":"Multi-page HMI demonstration",
"Libs":[],
"Target":"hmi\\index.html",
"Template":"",
"Title":"Multi-page HMI demonstration",
"Tooltips":true,
"ViewBox":true,
"checkedVersion":"9219"
},
"UserData":{},
"connections":[
{
"alias":"hint-text_O",
"cstring":"myproject_task.CNB:Y",
"type":"R"
},
{
"alias":"Led-constant",
"cstring":"myproject_task.CNB:Y",
"type":"R"
},
{
"alias":"Led-fast",
"cstring":"myproject_task.BIS_FAST:Y",
"type":"R"
},
{
"alias":"Led-slow",
"cstring":"myproject_task.BIS_SLOW:Y",
"type":"R"
}
],
"metaData":{
"desc":"Global RexHMI configuration component. User can change project options, configure the HTML export and define list of connections between REX target and HMI.",
"header_mode":{
"desc":"Change the default size of the header (thin, packed). If packed click on the logo to show the header.",
"order":"06",
"type":"enum",
"values":[
"",
"thin",
"pack-top-left",
"pack-top-right",
"pack-bottom-left",
"pack-bottom-right"
]
},
"kiosk_mode":{
"desc":"If True the links from header (from logo and header) are removed and user can not change the refresh rate and target.",
"order":"07",
"type":"bool"
},
"log_level":{
"desc":"Set the global log level for whole RexHMI. The log messages are written both to the right upper corner menu and to the web browser console. Default level is INFO.",
"order":"03",
"type":"enum",
"values":[
"",
"TRACE",
"DEBUG",
"INFO",
"WARN",
"ERROR"
]
},
"refresh_rate":{
"desc":"Changes the default read refresh rate of the whole HMI. Default 500ms",
"max":"300000",
"min":"20",
"order":"02",
"type":"int"
},
"show_clock":{
"desc":"If True the clock are shown in the right upper corner of the template instead of blinking square. If the target is connected the clock are updated if connection get error o lost the time stops.",
"order":"04",
"type":"bool"
},
"target_url":{
"desc":"The URL of the target device. So far only the WebSocket protocol is supported. The URL must also contain the PORT, but the protocol can be omitted. Default is empty string which means ws://127.0.0.1:8008 <br /> Examples: 192.168.1.100:8008 or wss://192.168.1.100:8009 <br /> <i> Note: If the HMI is hosted on the internal web server this option is ignored and HMI connects to the hostname / IP you use in the webbrowser URL.</i>",
"order":"01",
"prev":[
"ws_ip"
],
"type":"str"
},
"use_client_time":{
"desc":"If True the <code>show_clock</code> display the time from client computer rather then target. This can be use when target device does not have NTP synchronization or RTC chip.",
"order":"05",
"type":"bool"
}
},
"options":{
"header_mode":"",
"kiosk_mode":"False",
"log_level":"",
"refresh_rate":"",
"show_clock":"False",
"target_url":"",
"use_client_time":"False"
}
}

{
"connections":{
"disable_by":"",
"error_by":"",
"hide_by":"",
"value":"$T"
},
"metaData":{
"colorError":{
"desc":"LED background color when the signal error is TRUE.",
"order":"04",
"type":"color"
},
"colorFalse":{
"desc":"LED background color when the signal is OFF, DISABLED, ...",
"order":"03",
"prev":[
"colorStop",
"color_false"
],
"type":"color"
},
"colorTrue":{
"desc":"LED background color when the signal is ON, ENABLED, ...",
"order":"02",
"prev":[
"colorRun",
"color_true"
],
"type":"color"
},
"connections":{
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"error_by":{
"desc":"If set and TRUE the led will show <code>colorError</code>",
"optional":true,
"order":"02"
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"value":{
"desc":"Datapoint from which the value is read.",
"order":"01",
"prev":[
"LIGHT",
"POWER"
]
}
},
"desc":"Boolean state indicator. Empty or Zero mean OFF,FALSE, otherwise ON, TRUE. This can be switched using <code>reverseMeaning</code> parameter.",
"reverseMeaning":{
"desc":"If True the meaning of the value is switched. So the ON state is False and OFF state is True.",
"order":"01",
"type":"bool"
}
},
"options":{
"colorError":"#DF2626",
"colorFalse":"#5f5f5f",
"colorTrue":"#0033ee",
"reverseMeaning":"False"
}
}

